// components/UserSearch.tsx
import React, { useState } from 'react';

const UserSearch: React.FC = () => {
  const [userName, setUserName] = useState('');

//   const handleSearch = () => {
//     console.log(`Searching devices for user: ${userName}`);
//   };
const handleSearch = () => {
    fetch(`http://localhost:5000/api/user/search?userName=${userName}`)
      .then(response => response.json())
      .then(data => {
        // Now 'data' contains the devices associated with the user
        console.log(data);
        // Set your state variable here with the data
      })
      .catch(error => console.error(error));
  };
  return (
    <div className="card p-3">
      <h2 className="mb-3">Search User</h2>
      <div className="input-group">
        <input 
          type="text" 
          value={userName} 
          onChange={e => setUserName(e.target.value)} 
          className="form-control"
          placeholder="Search user..."
        />
        <div className="input-group-append">
          <button onClick={handleSearch} className="btn btn-outline-primary">Search</button>
        </div>
      </div>
    </div>
  );
}

export default UserSearch;
